import React from 'react';
import styled from 'styled-components';

const SupersetChart = ({ src }) => {
    return (
        <SupersetChartStyled>
            <iframe
                src={src}
                title="Superset Chart"
                width="100%"
                height="100%"
                frameBorder="0"
                allowFullScreen
            ></iframe>
        </SupersetChartStyled>
    );
};

const SupersetChartStyled = styled.div`
    width: 100%;
    height: 400px;
    border: 1px solid #ccc;
    border-radius: 8px;
    overflow: hidden;
    box-shadow: 0px 4px 10px rgba(0, 0, 0, 0.1);
`;

export default SupersetChart;
